contracts/CCK/Token/PriceOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";

/**
 * @title PriceOracle
 * @dev A contract for retrieving the current price from a Uniswap V3 pool.
 */
contract PriceOracle {
    address public uniswapPool; // Address of the Uniswap V3 pool

    /**
     * @dev Constructor to set the Uniswap V3 pool address.
     * @param _uniswapPool Address of the Uniswap V3 pool to be used for price retrieval.
     */
    constructor(address _uniswapPool) {
        uniswapPool = _uniswapPool;
    }

    /**
     * @dev Retrieves the current price from the Uniswap V3 pool.
     * @return uint256 The current price calculated from the pool's sqrtPriceX96.
     */
    function getCurrentPrice() external view returns (uint256) {
        IUniswapV3Pool pool = IUniswapV3Pool(uniswapPool);
        (uint160 sqrtPriceX96, , , , , , ) = pool.slot0();
        uint256 price = uint256(sqrtPriceX96) ** 2 / (2 ** 192); // Price calculation
        return price;
    }
}

contracts/CCK/Token/Freezable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title Freezable
 * @dev Contract that allows freezing and unfreezing of user accounts.
 */
contract Freezable {
    // Mapping to track frozen status of user accounts
    mapping(address => bool) public frozen;

    /**
     * @dev Freezes a user account, preventing it from performing certain actions.
     * @param user Address of the user to be frozen.
     */
    function freezeUser(address user) external {
        frozen[user] = true;
    }

    /**
     * @dev Unfreezes a user account, allowing it to perform actions again.
     * @param user Address of the user to be unfrozen.
     */
    function unfreezeUser(address user) external {
        frozen[user] = false;
    }

    /**
     * @dev Checks if a user account is frozen.
     * @param userAddress Address of the user to check.
     * @return bool Indicates if the user account is frozen.
     */
    function isFrozen(address userAddress) external view returns (bool) {
        return frozen[userAddress];
    }
}

contracts/CCK/Token/Whitelist.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title Whitelist
 * @dev A contract that manages a whitelist of addresses.
 */
contract Whitelist {
    // Mapping to track whitelisted addresses
    mapping(address => bool) public whitelist;

    /**
     * @dev Adds a member to the whitelist.
     * @param member Address of the user to be added to the whitelist.
     */
    function addToWhitelist(address member) external {
        whitelist[member] = true;
    }

    /**
     * @dev Removes a member from the whitelist.
     * @param member Address of the user to be removed from the whitelist.
     */
    function removeFromWhitelist(address member) external {
        whitelist[member] = false;
    }

    /**
     * @dev Checks if a member is in the whitelist.
     * @param member Address of the user to check.
     * @return bool Indicates if the user is whitelisted.
     */
    function isWhitelisted(address member) external view returns (bool) {
        return whitelist[member];
    }
}

